"ortho-Hydroxylated benzoic acid. It is obtained from the bark of the white willow and wintergreen leaves [ChEBI]. A compound obtained from the bark of the white willow and wintergreen leaves. It has bacteriostatic, fungicidal, and keratolytic actions [MeSH].", 
