"A hexose or fermentable monosaccharide and isomer of glucose from manna, the ash Fraxinus ornus and related plants. (From Grant & Hackh's Chemical Dictionary, 5th ed & Random House Unabridged Dictionary, 2d ed) [MeSH].", 
"Fructose is a levorotatory monosaccharide and an isomer of glucose.  Although fructose is a hexose (6 carbon sugar), it generally exists as a 5-member hemiketal ring (a furanose) [ChEBI]. A monosaccharide in sweet fruits and honey that is soluble in water, alcohol, or ether. It is used as a preservative and an intravenous infusion in parenteral feeding [MeSH].", 
"A galactopyranose having D-configuration [ChEBI]. An aldohexose that occurs naturally in the D-form in lactose, cerebrosides, gangliosides, and mucoproteins. Deficiency of galactosyl-1-phosphate uridyltransferase (GALACTOSE-1-PHOSPHATE URIDYL-TRANSFERASE DEFICIENCY DISEASE) causes an error in galactose metabolism called GALACTOSEMIA, resulting in elevations of galactose in the blood [MeSH].", 
"A D-aldohexose that is D-glucose in which the hydrogen of the hydroxy group at position 3 has been substituted by a methyl group. It is a non-metabolisable glucose analogue that is not phosphorylated by hexokinase and is used as a marker to assess glucose transport by evaluating its uptake within various cells and organ systems [ChEBI]. A non-metabolizable glucose analogue that is not phosphorylated by hexokinase. 3-O-Methylglucose is used as a marker to assess glucose transport by evaluating its uptake within various cells and organ systems. (J Neurochem 1993;60(4):1498-504) [MeSH].", 
NA, "The pyranose form of L-fucose [ChEBI].", "The L-enantiomer of rhamnose; occurs naturally in many plant glycosides and some gram-negative bacterial lipopolysaccharides [ChEBI]. A methylpentose whose L- isomer is found naturally in many plant glycosides and some gram-negative bacterial lipopolysaccharides [MeSH].", 
"A purine nucleoside in which hypoxanthine is attached to ribofuranose via a beta-N(9)-glycosidic bond [ChEBI]. A purine nucleoside that has hypoxanthine linked by the N9 nitrogen to the C1 carbon of ribose. It is an intermediate in the degradation of purines and purine nucleosides to uric acid and in pathways of purine salvage. It also occurs in the anticodon of certain transfer RNA molecules. (Dorland, 28th ed) [MeSH].", 
"The sodium salt of racemic or inactive lactic acid. It is a hygroscopic agent used intravenously as a systemic and urinary alkalizer [MeSH].", 
"A steroid antibiotic that is isolated from the fermentation broth of Fusidium coccineum [ChEBI]. An antibiotic isolated from the fermentation broth of Fusidium coccineum. (From Merck Index, 11th ed). It acts by inhibiting translocation during protein synthesis [MeSH].", 
"The R-enantiomer of serine [ChEBI]. A non-essential amino acid occurring in natural form as the L-isomer. It is synthesized from GLYCINE or THREONINE. It is involved in the biosynthesis of PURINES; PYRIMIDINES; and other amino acids [MeSH].", 
"The D-enantiomer of glucitol [ChEBI]. A polyhydric alcohol with about half the sweetness of sucrose. Sorbitol occurs naturally and is also produced synthetically from glucose. It was formerly used as a diuretic and may still be used as a laxative and in irrigating solutions for some surgical procedures. It is also used in many manufacturing processes, as a pharmaceutical aid, and in several research applications [MeSH].", 
NA, "An inositol having myo- configuration [ChEBI]. An isomer of glucose that has traditionally been considered to be a B vitamin although it has an uncertain status as a vitamin and a deficiency syndrome has not been identified in man. (From Martindale, The Extra Pharmacopoeia, 30th ed, p1379) Inositol phospholipids are important in signal transduction [MeSH].", 
"An triol that is propane substituted at positions 1, 2 and 3 by hydroxy groups [ChEBI]. A trihydroxy sugar alcohol that is an intermediate in carbohydrate and lipid metabolism. It is used as a solvent, emollient, pharmaceutical agent, and sweetening agent [MeSH].", 
"A glucopyranose ring with a phosphate replacing the hydroxy in the hydroxymethyl group at position 6 [ChEBI]. An ester of glucose with phosphoric acid, made in the course of glucose metabolism by mammalian and other cells. It is a normal constituent of resting muscle and probably is in constant equilibrium with fructose-6-phosphate. (Stedman, 26th ed) [MeSH].", 
"The five-membered ring form of D-fructose 6-phosphate [ChEBI].", 
"The D-enantiomer of aspartic acid [ChEBI]. The D-isomer of ASPARTIC ACID [MeSH].", 
"A macrolide antibiotic that is similar to ERYTHROMYCIN [MeSH].", 
NA, "A tetracycline analogue having a dimethylamino group at position 7 and lacking the methyl and hydroxy groups at position 5 [ChEBI]. A TETRACYCLINE analog, having a 7-dimethylamino and lacking the 5 methyl and hydroxyl groups, which is effective against tetracycline-resistant STAPHYLOCOCCUS infections [MeSH].", 
"A product formed from skin, white connective tissue, or bone COLLAGEN. It is used as a protein food adjuvant, plasma substitute, hemostatic, suspending agent in pharmaceutical preparations, and in the manufacturing of capsules and suppositories [MeSH].", 
"A dipeptide consisting of L-proline having a glycyl residue attached to its alpha-amino group [ChEBI].", 
"The L-enantiomer of alanine [ChEBI]. A non-essential amino acid that occurs in high levels in its free state in plasma. It is produced from pyruvate by transamination. It is involved in sugar and acid metabolism, increases IMMUNITY, and provides energy for muscle tissue, BRAIN, and the CENTRAL NERVOUS SYSTEM [MeSH].", 
"The L-enantiomer of aspartic acid [ChEBI]. One of the non-essential amino acids commonly occurring in the L-form. It is found in animals and plants, especially in sugar cane and sugar beets. It may be a neurotransmitter [MeSH].", 
"An optically active form of glutamic acid having L-configuration [ChEBI]. A non-essential amino acid naturally occurring in the L-form. Glutamic acid is the most common excitatory neurotransmitter in the CENTRAL NERVOUS SYSTEM [MeSH].", 
"The L-enantiomer of the amino acid histidine [ChEBI]. An essential amino acid that is required for the production of HISTAMINE [MeSH].", 
"An optically active form of 5-oxoproline having L-configuration [ChEBI]. A cyclized derivative of L-GLUTAMIC ACID. Elevated blood levels may be associated with problems of GLUTAMINE or GLUTATHIONE metabolism [MeSH].", 
"An antibiotic produced by Streptomyces lincolnensis var. lincolnensis. It has been used in the treatment of staphylococcal, streptococcal, and Bacteroides fragilis infections [MeSH].", 
"An aminocarboxamidine, the parent compound of the guanidines [ChEBI]. A strong organic base existing primarily as guanidium ions at physiological pH. It is found in the urine as a normal product of protein metabolism. It is also used in laboratory research as a protein denaturant. (From Martindale, the Extra Pharmacopoeia, 30th ed and Merck Index, 12th ed) It is also used in the treatment of myasthenia and as a fluorescent probe in HPLC [MeSH].", 
NA, "Any mixture of complex, colloidal, macromolecular plant galacturonans containing a large proportion of D-galactopyranosyluronic acid residues in alpha-(1->4) linkage, the carboxy groups of which may be esterified to varying degrees by methyl groups or be partially or completely converted into salts. The structure shown is that of the parent polygalacturonan [ChEBI].", 
NA, "A gluconic acid having D-configuration [ChEBI].", "A sugar acid formed by the oxidation of the C-6 carbon of GLUCOSE. In addition to being a key intermediate metabolite of the uronic acid pathway, glucuronic acid also plays a role in the detoxification of certain drugs and toxins by conjugating with them to form GLUCURONIDES [MeSH].", 
NA, "A hexaric acid resulting from formal oxidative ring cleavage of galactose [ChEBI].", 
"The (-)-enantiomer of quinic acid [ChEBI]. An acid which is found in cinchona bark and elsewhere in plants. (From Stedman, 26th ed) [MeSH].", 
"A sugar acid derived from D-glucose in which both the aldehydic carbon atom and the carbon atom bearing the primary hydroxyl group are oxidized to carboxylic acid groups [MeSH].", 
"A complex glycopeptide from Streptomyces orientalis. It inhibits a specific step in the synthesis of the peptidoglycan layer in the Gram-positive bacteria Staphylococcus aureus and Clostridium difficile [ChEBI]. Antibacterial obtained from Streptomyces orientalis. It is a glycopeptide related to RISTOCETIN that inhibits bacterial cell wall assembly and is toxic to kidneys and the inner ear [MeSH].", 
NA, NA, "A monocarboxylic acid that is acetic acid in which one of the methyl hydrogens is substituted by a 4-hydroxyphenyl group [ChEBI].", 
NA, "An optically active form of lactic acid having (S)-configuration [ChEBI]. A normal intermediate in the fermentation (oxidation, metabolism) of sugar. The concentrated form is used internally to prevent gastrointestinal fermentation. (From Stedman, 26th ed) [MeSH].", 
"A tricarboxylic acid that is propane-1,2,3-tricarboxylic acid bearing a hydroxy substituent at position 2 [ChEBI]. A key intermediate in metabolism. It is an acid compound found in citrus fruits. The salts of citric acid (citrates) can be used as anticoagulants due to their calcium chelating ability [MeSH].", 
"An oxo dicarboxylic acid that consists of glutaric acid bearing an oxo substituent at position 2 [ChEBI].", 
"An optically active form of malic acid having (S)-configuration [ChEBI].", 
"A dicarboxylic acid that is succinic acid substituted at position 2 by a bromno group [ChEBI].", 
"A monocarboxylic acid comprising 1,8-naphthyridin-4-one substituted by carboxylic acid, ethyl and methyl groups at positions 3, 1, and 7, respectively [ChEBI]. A synthetic 1,8-naphthyridine antimicrobial agent with a limited bacteriocidal spectrum. It is an inhibitor of the A subunit of bacterial DNA GYRASE [MeSH].", 
"A metal chloride salt with a Li(+) counterion [ChEBI]. A salt of lithium that has been used experimentally as an immunomodulator [MeSH].", 
NA, "An amino fatty acid composed of butanoic acid with the amino substituent located at C-4 [ChEBI]. The most common inhibitory neurotransmitter in the central nervous system [MeSH].", 
"A hydroxybutyric acid having a single hydroxyl group located at position 2; urinary secretion of 2-hydroxybutyric acid is increased with alcohol ingestion or vigorous physical exercise and is associated with lactic acidosis and ketoacidosis in humans and diabetes in animals [ChEBI].", 
"The conjugate base of (R)-3-hydroxybutyric acid [ChEBI].", "A 3-oxo monocarboxylic acid that is butyric acid bearing a 3-oxo substituent [ChEBI].", 
"A short-chain saturated fatty acid comprising ethane attached to the carbon of a carboxy group [ChEBI].", 
"A simple monocarboxylic acid containing two carbons [ChEBI]. Product of the oxidation of ethanol and of the destructive distillation of wood. It is used locally, occasionally internally, as a counterirritant and also as a reagent. (Stedman, 26th ed) [MeSH].", 
"An organic sodium salt which is the monosodium salt of formic acid [ChEBI].", 
"A synthetic monocyclic beta-lactam antibiotic (monobactam) [ChEBI]. A monocyclic beta-lactam antibiotic originally isolated from Chromobacterium violaceum. It is resistant to beta-lactamases and is used in gram-negative infections, especially of the meninges, bladder, and kidneys. It may cause a superinfection with gram-positive organisms [MeSH].", 
"A four-carbon straight-chain saturated fatty acid [ChEBI]. A four carbon acid, CH3CH2CH2COOH, with an unpleasant odor that occurs in butter and animal fat as the glycerol ester [MeSH].", 
NA, "A pentitol (five-carbon sugar alcohol) having meso-configuration, being derived from xylose by reduction of the carbonyl group [ChEBI]. A five-carbon sugar alcohol derived from XYLOSE by reduction of the carbonyl group. It is as sweet as sucrose and used as a noncariogenic sweetener [MeSH].", 
"A 2-oxo monocarboxylic acid that is the 2-keto derivative of propionic acid [ChEBI]. An intermediate compound in the metabolism of carbohydrates, proteins, and fats. In thiamine deficiency, its oxidation is retarded and it accumulates in the tissues, especially in nervous structures. (From Stedman, 26th ed) [MeSH].", 
"An alpha-D-glucoside consisting of D-glucitol having an alpha-D-glucosyl residue attached at the 4-position. Used as a sugar substitute [ChEBI].", 
"A maltotriose trisaccharide in which the glucose residue at the reducing end is in the aldehydo open-chain form [ChEBI].", 
"A primary source of energy for living organisms. It is naturally occurring and is found in fruits and other parts of plants in its free state. It is used therapeutically in fluid and nutrient replacement [MeSH].", 
"An alpha-D-glucopyranoside having a methyl substituent at the anomeric position [ChEBI].", 
"A chondroitin sulfate in which the site of sulfation is carbon 6 of the N-acetylgalactosamine (GalNAc) sugar [ChEBI]. Derivatives of chondroitin which have a sulfate moiety esterified to the galactosamine moiety of chondroitin. Chondroitin sulfate A, or chondroitin 4-sulfate, and chondroitin sulfate C, or chondroitin 6-sulfate, have the sulfate esterified in the 4- and 6-positions, respectively. Chondroitin sulfate B (beta heparin; DERMATAN SULFATE) is a misnomer and this compound is not a true chondroitin sulfate [MeSH].", 
