NA, "A synthetic galactosylfructose disaccharide used in the treatment of constipation and hepatic encephalopathy [ChEBI]. A synthetic disaccharide used in the treatment of constipation and hepatic encephalopathy. It has also been used in the diagnosis of gastrointestinal disorders. (From Martindale, The Extra Pharmacopoeia, 30th ed, p887) [MeSH].", 
