"The L-enantiomer of arabinose [ChEBI].", NA, NA, "The simplest member of the class of propane-1,2-diols, consisting of propane in which a hydrogen at position 1 and a hydrogen at position 2 are substituted by hydroxy groups. A colourless, viscous, hygroscopic, low-melting (-59degreeC) and high-boiling (188degreeC) liquid with low toxicity, it is used as a solvent, emulsifying agent, and antifreeze [ChEBI]. A clear, colorless, viscous organic solvent and diluent used in pharmaceutical preparations [MeSH].", 
"Ethane with an amino substituent at C-1 and a hydroxy substituent at C-2, making it both a primary amine and a primary alcohol [ChEBI]. A viscous, hygroscopic amino alcohol with an ammoniacal odor. It is widely distributed in biological tissue and is a component of lecithin. It is used as a surfactant, fluorimetric reagent, and to remove CO2 and H2S from natural gas and other gases [MeSH].", 
"A tricarboxylic acid that is glutaric acid in which one of the beta-hydrogens is substituted by a carboxy group [ChEBI].", 
