"An inorganic chloride salt having sodium(1+) as the counterion [ChEBI]. A ubiquitous sodium salt that is commonly used to season food [MeSH].", 
"An acidifying agent that has expectorant and diuretic effects. Also used in etching and batteries and as a flux in electroplating [MeSH].", 
"Selenious acid, disodium salt. It is used therapeutically to supply the trace element selenium [MeSH].", 
"A metal chloride salt with a K(+) counterion [ChEBI]. A white crystal or crystalline powder used in BUFFERS; FERTILIZERS; and EXPLOSIVES. It can be used to replenish ELECTROLYTES and restore WATER-ELECTROLYTE BALANCE in treating HYPOKALEMIA [MeSH].", 
"A salt used to replenish calcium levels, as an acid-producing diuretic, and as an antidote for magnesium poisoning [MeSH].", 
"A trace element with atomic symbol Mn, atomic number 25, and atomic weight 54.94. It is concentrated in cell mitochondria, mostly in the pituitary gland, liver, pancreas, kidney, and bone, influences the synthesis of mucopolysaccharides, stimulates hepatic synthesis of cholesterol and fatty acids, and is a cofactor in many enzymes, including arginase and alkaline phosphatase in the liver. (From AMA Drug Evaluations Annual 1992, p2035) [MeSH].", 
"A compound of zinc and chloride ions in the ratio 1:2. It exists in four crystalline forms, in each of which the Zn(2+) ions are trigonal planar coordinated to four chloride ions [ChEBI].", 
"Chloride of copper in which the metal is in the +2 oxidation state [ChEBI].", 
NA, "Chemical element with atomic number 53 [ChEBI]. A nonmetallic element of the halogen group that is represented by the atomic symbol I, atomic number 53, and atomic weight of 126.90. It is a nutritionally essential element, especially important in thyroid hormone synthesis. In solution, it has anti-infective properties and is used topically [MeSH].", 
NA, NA, NA, "An inorganic sodium salt having tungstate as the counterion. Combines with hydrogen peroxide for the oxidation of secondary amines to nitrones [ChEBI].", 
"An inorganic sodium salt of formula Na3VO4 containing the tetrahedral VO4(3-) [ChEBI].", 
NA, "An inorganic sodium salt comprised of a diphosphate(4-) anion and four sodium(1+) cations. More commonly known as tetrasodium pyrophosphate, it finds much use in the food industry as an emulsifier and in dental hygiene as a calcium-chelating salt [ChEBI].", 
"The inorganic nitrate salt of sodium [ChEBI].", "The nitrogen oxoanion formed by loss of a proton from nitrous acid [ChEBI]. Nitrous acid sodium salt. Used in many industrial processes, in meat curing, coloring, and preserving, and as a reagent in ANALYTICAL CHEMISTRY TECHNIQUES. It is used therapeutically as an antidote in cyanide poisoning. The compound is toxic and mutagenic and will react in vivo with secondary or tertiary amines thereby producing highly carcinogenic nitrosamines [MeSH].", 
"A metallic element with atomic symbol Fe, atomic number 26, and atomic weight 55.85. It is an essential constituent of HEMOGLOBINS; CYTOCHROMES; and IRON-BINDING PROTEINS. It plays a role in cellular redox reactions and in the transport of OXYGEN [MeSH].", 
"Magnesium chloride. An inorganic compound consisting of one magnesium and two chloride ions. The compound is used in medicine as a source of magnesium ions, which are essential for many cellular activities. It has also been used as a cathartic and in alloys [MeSH].", 
NA, "An oxopurine that is xanthine which is substituted at positions 1 and 3 by methyl and isobutyl groups, respectively [ChEBI]. A potent cyclic nucleotide phosphodiesterase inhibitor; due to this action, the compound increases cyclic AMP and cyclic GMP in tissue and thereby activates CYCLIC NUCLEOTIDE-REGULATED PROTEIN KINASES [MeSH].", 
"A trimethylxanthine in which the three methyl groups are located at positions 1, 3, and 7 [ChEBI]. A methylxanthine naturally occurring in some beverages and also used as a pharmacological agent. Caffeine's most notable pharmacological effect is as a central nervous system stimulant, increasing alertness and producing agitation. It also relaxes SMOOTH MUSCLE, stimulates CARDIAC MUSCLE, stimulates DIURESIS, and appears to be useful in the treatment of some types of headache. Several cellular actions of caffeine have been observed, but it is not entirely clear how each contributes to its pharmacological profile. Among the most important are inhibition of cyclic nucleotide PHOSPHODIESTERASES, antagonism of ADENOSINE RECEPTORS, and modulation of intracellular calcium handling [MeSH].", 
"The R-enantiomer of adrenaline [ChEBI]. The active sympathomimetic hormone from the ADRENAL MEDULLA. It stimulates both the alpha- and beta- adrenergic systems, causes systemic VASOCONSTRICTION and gastrointestinal relaxation, stimulates the HEART, and dilates BRONCHI and cerebral vessels. It is used in ASTHMA and CARDIAC FAILURE and to delay absorption of local ANESTHETICS [MeSH].", 
"The R-enantiomer of noradrenaline [ChEBI]. Precursor of epinephrine that is secreted by the adrenal medulla and is a widespread central and autonomic neurotransmitter. Norepinephrine is the principal transmitter of most postganglionic sympathetic fibers and of the diffuse projection system in the brain arising from the locus ceruleus. It is also found in plants and is used pharmacologically as a sympathomimetic [MeSH].", 
"A derivative of glycine having methyl and amidino groups attached to the nitrogen [ChEBI]. An amino acid that occurs in vertebrate tissues and in urine. In muscle tissue, creatine generally occurs as phosphocreatine. Creatine is excreted as CREATININE in the urine [MeSH].", 
"An iodothyronine compound having iodo substituents at the 3-, 3'- and 5-positions. Although some is produced in the thyroid, most of the 3,3',5-triiodo-L-thyronine in the body is generated by mono-deiodination of L-thyroxine in the peripheral tissues. Its metabolic activity is about 3 to 5 times that of L-thyroxine. The sodium salt is used in the treatment of hypothyroidism [ChEBI]. A T3 thyroid hormone normally synthesized and secreted by the thyroid gland in much smaller quantities than thyroxine (T4). Most T3 is derived from peripheral monodeiodination of T4 at the 5' position of the outer ring of the iodothyronine nucleus. The hormone finally delivered and used by the tissues is mainly T3 [MeSH].", 
"The amino acid zwitterion formed from thyroxine by transfer of a proton from the carboxy group to the amino group.  Major species at pH 7.3 [ChEBI]. The major hormone derived from the thyroid gland. Thyroxine is synthesized via the iodination of tyrosines (MONOIODOTYROSINE) and the coupling of iodotyrosines (DIIODOTYROSINE) in the THYROGLOBULIN. Thyroxine is released from thyroglobulin by proteolysis and secreted into the blood. Thyroxine is peripherally deiodinated to form TRIIODOTHYRONINE which exerts a broad spectrum of stimulatory effects on cell metabolism [MeSH].", 
"An anti-inflammatory 9-fluoro-glucocorticoid [MeSH].", "Cortisol is a corticosteroid hormone or glucocorticoid produced by zona fasciculata of the adrenal cortex, which is a part of the adrenal gland. It is usually referred to as the \\\\stress hormone\\\\ as it is involved in response to stress and anxiety, controlled by corticotropin-releasing hormone (CRH). It increases blood pressure and blood sugar, and reduces immune responses [ChEBI]. The main glucocorticoid secreted by the ADRENAL CORTEX. Its synthetic counterpart is used, either as an injection or topically, in the treatment of inflammation, allergy, collagen diseases, asthma, adrenocortical deficiency, shock, and some neoplastic conditions [MeSH].", 
"A C21-steroid hormone in which a pregnane skeleton carries oxo substituents at positions 3 and 20 and is unsaturated at C(4)-C(5). As a hormone, it is involved in the female menstrual cycle, pregnancy and embryogenesis of humans and other species [ChEBI]. The major progestational steroid that is secreted primarily by the CORPUS LUTEUM and the PLACENTA. Progesterone acts on the UTERUS, the MAMMARY GLANDS and the BRAIN. It is required in EMBRYO IMPLANTATION; PREGNANCY maintenance, and the development of mammary tissue for MILK production. Progesterone, converted from PREGNENOLONE, also serves as an intermediate in the biosynthesis of GONADAL STEROID HORMONES and adrenal CORTICOSTEROIDS [MeSH].", 
"The 17beta-isomer of estradiol [ChEBI]. Generally refers to the 17-beta-isomer of estradiol, an aromatized C18 steroid with hydroxyl group at 3-beta- and 17-beta-position. Estradiol-17-beta is the most potent form of mammalian estrogenic steroids. In humans, it is produced primarily by the cyclic ovaries and the PLACENTA. It is also produced by the adipose tissue of men and postmenopausal women. The 17-alpha-isomer of estradiol binds weakly to estrogen receptors (RECEPTORS, ESTROGEN) and exhibits little estrogenic activity in estrogen-responsive tissues. Various isomers can be synthesized [MeSH].", 
"A potent androgenic metabolite of TESTOSTERONE. It is produced by the action of the enzyme 3-OXO-5-ALPHA-STEROID 4-DEHYDROGENASE [MeSH].", 
"A pregnane-based steroidal hormone produced by the outer-section (zona glomerulosa) of the adrenal cortex in the adrenal gland, and acts on the distal tubules and collecting ducts of the kidney to cause the conservation of sodium, secretion of potassium, increased water retention, and increased blood pressure. The overall effect of aldosterone is to increase reabsorption of ions and water in the kidney [ChEBI]. A hormone secreted by the ADRENAL CORTEX that regulates electrolyte and water balance by increasing the renal retention of sodium and the excretion of potassium [MeSH].", 
"A peptide hormone produced in the pancreas and involved in regulating the metabolism of carbohydrates (particularly glucose) and fats. Commonly thought of as a protein, it consists of two petide chains, one containing 21 amino acid residues and the other containing 30; the chains are joined together by 2 disulfide bonds. Recombinant insulin is identical to human insulin, but is synthesised by inserting the human insulin gene into E. coli, which then produces insulin for human use. It is used in the treatment of type I and type II diabetes [ChEBI]. A 51-amino acid pancreatic hormone that plays a major role in the regulation of glucose metabolism, directly by suppressing endogenous glucose production (GLYCOGENOLYSIS; GLUCONEOGENESIS) and indirectly by suppressing GLUCAGON secretion and LIPOLYSIS. Native insulin is a globular protein comprised of a zinc-coordinated hexamer. Each insulin monomer containing two chains, A (21 residues) and B (30 residues), linked by two disulfide bonds. Insulin is used as a drug to control insulin-dependent diabetes mellitus (DIABETES MELLITUS, TYPE 1) [MeSH].", 
"A 12-kDa cysteine-rich polypeptide hormone secreted by FAT CELLS in the ADIPOSE TISSUE. It is the founding member of the resistin-like molecule (RELM) hormone family. Resistin suppresses the ability of INSULIN to stimulate cellular GLUCOSE uptake [MeSH].", 
"A 29-amino acid peptide hormone consisting of His, Ser, Gln, Gly, Thr, Phe, Thr, Ser, Asp, Tyr, Ser, Lys, Tyr, Leu, Asp, Ser, Arg, Arg, Ala, Gln, Asp, Phe, Val, Gln, Trp, Leu, Met, Asn and Thr residues joined in sequence [ChEBI]. A 29-amino acid pancreatic peptide derived from proglucagon which is also the precursor of intestinal GLUCAGON-LIKE PEPTIDES. Glucagon is secreted by PANCREATIC ALPHA CELLS and plays an important role in regulation of BLOOD GLUCOSE concentration, ketone metabolism, and several other biochemical and physiological processes. (From Gilman et al., Goodman and Gilman's The Pharmacological Basis of Therapeutics, 9th ed, p1511) [MeSH].", 
"A 28-amino acid, acylated, orexigenic peptide that is a ligand for GROWTH HORMONE SECRETAGOGUE RECEPTORS. Ghrelin is widely expressed but primarily in the stomach in the adults. Ghrelin acts centrally to stimulate growth hormone secretion and food intake, and peripherally to regulate energy homeostasis. Its large precursor protein, known as appetite-regulating hormone or motilin-related peptide, contains ghrelin and obestatin [MeSH].", 
"A 16-kDa peptide hormone secreted from WHITE ADIPOCYTES. Leptin serves as a feedback signal from fat cells to the CENTRAL NERVOUS SYSTEM in regulation of food intake, energy balance, and fat storage [MeSH].", 
"A family of gastrointestinal peptide hormones that excite the secretion of GASTRIC JUICE. They may also occur in the central nervous system where they are presumed to be neurotransmitters [MeSH].", 
NA, NA, "A well-characterized basic peptide believed to be secreted by the liver and to circulate in the blood. It has growth-regulating, insulin-like, and mitogenic activities. This growth factor has a major, but not absolute, dependence on GROWTH HORMONE. It is believed to be mainly active in adults in contrast to INSULIN-LIKE GROWTH FACTOR II, which is a major fetal growth factor [MeSH].", 
NA, NA, NA, "A soluble substance elaborated by antigen- or mitogen-stimulated T-LYMPHOCYTES which induces DNA synthesis in naive lymphocytes [MeSH].", 
"A cytokine that stimulates the growth and differentiation of B-LYMPHOCYTES and is also a growth factor for HYBRIDOMAS and plasmacytomas. It is produced by many different cells including T-LYMPHOCYTES; MONOCYTES; and FIBROBLASTS [MeSH].", 
"A member of the CXC chemokine family that plays a role in the regulation of the acute inflammatory response. It is secreted by variety of cell types and induces CHEMOTAXIS of NEUTROPHILS and other inflammatory cells [MeSH].", 
NA, "A polypeptide hormone (84 amino acid residues) secreted by the PARATHYROID GLANDS which performs the essential role of maintaining intracellular CALCIUM levels in the body. Parathyroid hormone increases intracellular calcium by promoting the release of CALCIUM from BONE, increases the intestinal absorption of calcium, increases the renal tubular reabsorption of calcium, and increases the renal excretion of phosphates [MeSH].", 
"A lactogenic hormone secreted by the adenohypophysis (PITUITARY GLAND, ANTERIOR). It is a polypeptide of approximately 23 kD. Besides its major action on lactation, in some species prolactin exerts effects on reproduction, maternal behavior, fat metabolism, immunomodulation and osmoregulation. Prolactin receptors are present in the mammary gland, hypothalamus, liver, ovary, testis, and prostate [MeSH].", 
"A 32-membered heterodetic cyclic peptide comprising the sequence Cys-Ser-Asn-Leu-Ser-Thr-Cys-Val-Leu-Gly-Lys-Leu-Ser-Gln-Glu-Leu-His-Lys-Leu-Gln-Thr-Tyr-Pro-Arg-Thr-Asn-Thr-Gly-Ser-Gly-Thr-Pro-NH2 cyclised by a disulfide bridge between the two Cys residues at positions 1 and 7 [ChEBI]. A peptide hormone that lowers calcium concentration in the blood. In humans, it is released by thyroid cells and acts to decrease the formation and absorptive activity of osteoclasts. Its role in regulating plasma calcium is much greater in children and in certain diseases than in normal adults [MeSH].", 
NA, NA, "A ten-membered synthetic oligopeptide comprising pyroglutamyl, histidyl, tryptophyl, seryl, tyrosyl, glycyl, leucyl, arginyl, prolyl and glycinamide residues joined in sequence [ChEBI]. A decapeptide that stimulates the synthesis and secretion of both pituitary gonadotropins, LUTEINIZING HORMONE and FOLLICLE STIMULATING HORMONE. GnRH is produced by neurons in the septum PREOPTIC AREA of the HYPOTHALAMUS and released into the pituitary portal blood, leading to stimulation of GONADOTROPHS in the ANTERIOR PITUITARY GLAND [MeSH].", 
NA, "A polypeptide hormone produced and secreted by the pituitary gland comprising 39 amino acid residues coupled in a linear sequence. The N-terminal 24-amino acid segment is identical in all species and contains the adrenocorticotrophic activity. Corticotropin stimulates the cortex of the adrenal gland and boosts the synthesis of corticosteroids, mainly glucocorticoids but also sex steroids (androgens). It is used in the treatment of certain neurological disorders such as infantile spasms and multiple sclerosis, and diagnostically to investigate adrenocortical insufficiency [ChEBI]. An anterior pituitary hormone that stimulates the ADRENAL CORTEX and its production of CORTICOSTEROIDS. ACTH is a 39-amino acid polypeptide of which the N-terminal 24-amino acid segment is identical in all species and contains the adrenocorticotrophic activity. Upon further tissue-specific processing, ACTH can yield ALPHA-MSH and corticotrophin-like intermediate lobe peptide (CLIP) [MeSH].", 
NA, "A tripeptide composed of L-pyroglutamyl, L-histidyl and L-prolinamide residues joined in sequence [ChEBI]. A tripeptide that stimulates the release of THYROTROPIN and PROLACTIN. It is synthesized by the neurons in the PARAVENTRICULAR NUCLEUS of the HYPOTHALAMUS. After being released into the pituitary portal circulation, TRH (was called TRF) stimulates the release of TSH and PRL from the ANTERIOR PITUITARY GLAND [MeSH].", 
NA, NA, NA, NA, NA, "A member of the class of rotenones that consists of 1,2,12,12a-tetrahydrochromeno[3,4-b]furo[2,3-h]chromen-6(6aH)-one substituted at position 2 by a prop-1-en-2-yl group and at positions 8 and 9 by methoxy groups (the 2R,6aS,12aS-isomer). A non-systemic insecticide, it is the principal insecticidal constituent of derris (the dried rhizome and root of Derris elliptica) [ChEBI]. A botanical insecticide that is an inhibitor of mitochondrial electron transport [MeSH].", 
NA, NA, "A pentacyclic triterpenoid that is 24,25,26-trinoroleana-1(10),3,5,7-tetraen-29-oic acid bearing an oxo substituent at position 2, a hydroxy substituent at position 3 and two methyl groups at positions 9 and 13. An antioxidant and anti-inflammatory agent. Potently inhibits lipid peroxidation in mitochondria and inhibits TNF-alpha-induced NFkappaB activation. Also shown to inhibit topoisomerase II activity in vitro (IC50 = 7.41 muM) [ChEBI].", 
NA, NA, "A compound composed of a two CYCLIC PEPTIDES attached to a phenoxazine that is derived from STREPTOMYCES parvullus. It binds to DNA and inhibits RNA synthesis (transcription), with chain elongation more sensitive than initiation, termination, or release. As a result of impaired mRNA production, protein synthesis also declines after dactinomycin therapy. (From AMA Drug Evaluations Annual, 1993, p2015) [MeSH].", 
"An alkylating agent in cancer therapy that may also act as a mutagen by interfering with and causing damage to DNA [MeSH].", 
"An immunosuppressive agent used in combination with cyclophosphamide and hydroxychloroquine in the treatment of rheumatoid arthritis. According to the Fourth Annual Report on Carcinogens (NTP 85-002, 1985), this substance has been listed as a known carcinogen. (Merck Index, 11th ed) [MeSH].", 
"A methanesulfonate ester that is butane-1,4-diol in which the hydrogens of the hydroxy groups are replaced by methanesulfonyl groups. An alkylating antineoplastic agent, it is used for the treatment of chronic myeloid leukemia (although it has been largely replaced by newer drugs). It is also used as an insect sterilant [ChEBI]. An alkylating agent having a selective immunosuppressive effect on BONE MARROW. It has been used in the palliative treatment of chronic myeloid leukemia (MYELOID LEUKEMIA, CHRONIC), but although symptomatic relief is provided, no permanent remission is brought about. According to the Fourth Annual Report on Carcinogens (NTP 85-002, 1985), busulfan is listed as a known carcinogen [MeSH].", 
"An anthracycline produced by Streptomyces galilaeus. It has potent antineoplastic activity [MeSH].", 
"A dichloro-substituted acetamide containing a nitrobenzene ring, an amide bond and two alcohol functions [ChEBI]. An antibiotic first isolated from cultures of Streptomyces venequelae in 1947 but now produced synthetically. It has a relatively simple structure and was the first broad-spectrum antibiotic to be discovered. It acts by interfering with bacterial protein synthesis and is mainly bacteriostatic. (From Martindale, The Extra Pharmacopoeia, 29th ed, p106) [MeSH].", 
"The prototypical antimalarial agent with a mechanism that is not well understood. It has also been used to treat rheumatoid arthritis, systemic lupus erythematosus, and in the systemic therapy of amebic liver abscesses [MeSH].", 
"The monohydrate of cyclophosphamide [ChEBI]. Precursor of an alkylating nitrogen mustard antineoplastic and immunosuppressive agent that must be activated in the LIVER to form the active aldophosphamide. It has been used in the treatment of LYMPHOMA and LEUKEMIA. Its side effect, ALOPECIA, has been used for defleecing sheep. Cyclophosphamide may also cause sterility, birth defects, mutations, and cancer [MeSH].", 
"An anthelmintic used primarily as the citrate in the treatment of filariasis, particularly infestations with Wucheria bancrofti or Loa loa [MeSH].", 
"A pyridoisoquinoline comprising emetam having methoxy substituents at the 6'-, 7'-, 10- and 11-positions [ChEBI]. The principal alkaloid of ipecac, from the ground roots of Uragoga (or Cephaelis) ipecacuanha or U. acuminata, of the Rubiaceae. It is used as an amebicide in many different preparations and may cause serious cardiac, hepatic, or renal damage and violent diarrhea and vomiting. Emetine inhibits protein synthesis in EUKARYOTIC CELLS but not PROKARYOTIC CELLS [MeSH].", 
"A pyrimidine analog that is an antineoplastic antimetabolite. It interferes with DNA synthesis by blocking the THYMIDYLATE SYNTHETASE conversion of deoxyuridylic acid to thymidylic acid [MeSH].", 
"An antineoplastic agent that inhibits DNA synthesis through the inhibition of ribonucleoside diphosphate reductase [MeSH].", 
"A vesicant and necrotizing irritant destructive to mucous membranes. It was formerly used as a war gas. The hydrochloride is used as an antineoplastic in Hodgkin's disease and lymphomas. It causes severe gastrointestinal and bone marrow damage [MeSH].", 
"An antimetabolite antineoplastic agent with immunosuppressant properties. It interferes with nucleic acid synthesis by inhibiting purine metabolism and is used, usually in combination with other drugs, in the treatment of or in remission maintenance programs for leukemia [MeSH].", 
"An acridine derivative formerly widely used as an antimalarial but superseded by chloroquine in recent years. It has also been used as an anthelmintic and in the treatment of giardiasis and malignant effusions. It is used in cell biological experiments as an inhibitor of phospholipase A2 [MeSH].", 
NA, "One of the SELECTIVE ESTROGEN RECEPTOR MODULATORS with tissue-specific activities. Tamoxifen acts as an anti-estrogen (inhibiting agent) in the mammary tissue, but as an estrogen (stimulating agent) in cholesterol metabolism, bone density, and cell proliferation in the ENDOMETRIUM [MeSH].", 
"A 2-aminopurine that is the 6-thiono derivative of 2-amino-1,9-dihydro-6H-purine [ChEBI]. An antineoplastic compound which also has antimetabolite action. The drug is used in the therapy of acute leukemia [MeSH].", 
NA, "An organosulfonate salt obtained by reaction of pentamidine with two equivalents of 2-hydroxyethylsulfonic acid [ChEBI]. Antiprotozoal agent effective in trypanosomiasis, leishmaniasis, and some fungal infections; used in treatment of PNEUMOCYSTIS pneumonia in HIV-infected patients. It may cause diabetes mellitus, central nervous system damage, and other toxic effects [MeSH].", 
"A member of the class of 2-benzofurans that is 2-benzofuran-1(3H)-one which is substituted at positions 4, 5, 6, and 7 by methyl, methoxy, (2E)-5-carboxy-3-methylpent-2-en-1-yl, and hydroxy groups, respectively. It is an antibiotic produced by Penicillium brevi-compactum, P. stoloniferum, P. echinulatum and related species. An immunosuppressant, it is widely used (partiularly as its sodium salt and as the 2-(morpholin-4-yl)ethyl ester prodrug, mycophenolate mofetil) to prevent tissue rejection following organ transplants and for the treatment of certain autoimmune diseases [ChEBI]. An antibiotic substance derived from Penicillium stoloniferum, and related species. It blocks de novo biosynthesis of purine nucleotides by inhibition of the enzyme inosine monophosphate dehydrogenase. Mycophenolic acid is important because of its selective effects on the immune system. It prevents the proliferation of T-cells, lymphocytes, and the formation of antibodies from B-cells. It also may inhibit recruitment of leukocytes to inflammatory sites. (From Gilman et al., Goodman and Gilman's The Pharmacological Basis of Therapeutics, 9th ed, p1301) [MeSH].", 
"A folic acid derivative used as a rodenticide that has been shown to be teratogenic [MeSH].", 
"An alkaloid from Hydrastis canadensis L., Berberidaceae. It is also found in many other plants. It is relatively toxic parenterally, but has been used orally for various parasitic and fungal infections and as antidiarrheal [MeSH].", 
"A member of the class of hydroxyanthraquinones that is 9,10-anthraquinone which is substituted by hydroxy groups at positions 1, 3, and 8 and by a methyl group at position 6. It is present in the roots and barks of numerous plants (particularly rhubarb and buckthorn), moulds, and lichens. It is an active ingredient of various Chinese herbs [ChEBI]. Purgative anthraquinone found in several plants, especially Rhamnus frangula. It was formerly used as a laxative, but is now used mainly as tool in toxicity studies [MeSH].", 
"An aminonucleoside antibiotic, derived from the Streptomyces alboniger bacterium, that causes premature chain termination during translation taking place in the ribosome [ChEBI]. A cinnamamido ADENOSINE found in STREPTOMYCES alboniger. It inhibits protein synthesis by binding to RNA. It is an antineoplastic and antitrypanosomal agent and is used in research as an inhibitor of protein synthesis [MeSH].", 
NA, NA, "An organoplatinum compound that possesses antineoplastic activity [MeSH].", 
"A platinum-containing anticancer drug that interacts with, and forms cross-links between, DNA and proteins. It is used as a neoplasm inhibitor to treat solid tumours, primarily of the testis and ovary [ChEBI]. An inorganic and water-soluble platinum complex. After undergoing hydrolysis, it reacts with DNA to produce both intra and interstrand crosslinks. These crosslinks appear to impair replication and transcription of DNA. The cytotoxicity of cisplatin correlates with cellular arrest in the G2 phase of the cell cycle [MeSH].", 
"A pyrimidine 2',3'-dideoxyribonucleoside compound having a 3'-azido substituent and thymine as the nucleobase [ChEBI]. A dideoxynucleoside compound in which the 3'-hydroxy group on the sugar moiety has been replaced by an azido group. This modification prevents the formation of phosphodiester linkages which are needed for the completion of nucleic acid chains. The compound is a potent inhibitor of HIV replication, acting as a chain-terminator of viral DNA during reverse transcription. It improves immunologic function, partially reverses the HIV-induced neurological dysfunction, and improves certain other clinical abnormalities associated with AIDS. Its principal toxic effect is dose-dependent suppression of bone marrow, resulting in anemia and leukopenia [MeSH].", 
"A pyrimidine analogue that inhibits DNA methyltransferase, impairing DNA methylation. It is also an antimetabolite of cytidine, incorporated primarily into RNA. Azacytidine has been used as an antineoplastic agent [MeSH].", 
"Antibiotic substance isolated from streptomycin-producing strains of Streptomyces griseus. It acts by inhibiting elongation during protein synthesis [MeSH].", 
"Antibiotic substance produced by various Streptomyces species. It is an inhibitor of enzymatic activities that involve glutamine and is used as an antineoplastic and immunosuppressive agent [MeSH].", 
