NA, "Octopamine is a biogenic phenylethanolamine, which has been found to act as a neurotransmitter, neurohormone or neuromodulator in invertebrates [ChEBI]. An alpha-adrenergic sympathomimetic amine, biosynthesized from tyramine in the CNS and platelets and also in invertebrate nervous systems. It is used to treat hypotension and as a cardiotonic. The natural D(-) form is more potent than the L(+) form in producing cardiovascular adrenergic responses. It is also a neurotransmitter in some invertebrates [MeSH].", 
