NA, "An aminoimidazole in which the amino group is at C-5 with a carboxamido group at C-4 [ChEBI].", 
"A purine nucleobase that consists of purine bearing an oxo substiuent at position 6 [ChEBI]. A purine and a reaction intermediate in the metabolism of adenosine and in the formation of nucleic acids by the salvage pathway [MeSH].", 
NA, "A cyclohexadiene carboxylic acid derived from SHIKIMIC ACID and a precursor for the biosynthesis of UBIQUINONE and the AROMATIC AMINO ACIDS [MeSH].", 
NA, "The L-enantiomer of homoserine lactone [ChEBI].", "The meso-isomer of 2,6-diaminopimelic acid [ChEBI].", 
"A pyrimidine 2'-deoxyribonucleoside having cytosine as the nucleobase [ChEBI].", 
"The trication of spermidine, formed by protonation at all three nitrogens [ChEBI]. A polyamine formed from putrescine. It is found in almost all tissues in association with nucleic acids. It is found as a cation at all pH values, and is thought to help stabilize some membranes and nucleic acid structures. It is a precursor of spermine [MeSH].", 
"A polyazaalkane that is tetradecane in which the carbons at positions 1, 5, 10 and 14 are replaced by nitrogens. Spermine has broad actions on cellular metabolism [ChEBI]. A biogenic polyamine formed from spermidine. It is found in a wide variety of organisms and tissues and is an essential growth factor in some bacteria. It is found as a polycation at all pH values. Spermine is associated with nucleic acids, particularly in viruses, and is thought to stabilize the helical structure [MeSH].", 
"The 4-methanol form of VITAMIN B 6 which is converted to PYRIDOXAL PHOSPHATE which is a coenzyme for synthesis of amino acids, neurotransmitters (serotonin, norepinephrine), sphingolipids, aminolevulinic acid. Although pyridoxine and Vitamin B 6 are still frequently used as synonyms, especially by medical researchers, this practice is erroneous and sometimes misleading (EE Snell; Ann NY Acad Sci, vol 585 pg 1, 1990) [MeSH].", 
"A pyridinecarbaldehyde that is pyridine-4-carbaldehyde bearing methyl, hydroxy and hydroxymethyl substituents at positions 2, 3 and 5 respectively [ChEBI]. The 4-carboxyaldehyde form of VITAMIN B 6 which is converted to PYRIDOXAL PHOSPHATE which is a coenzyme for synthesis of amino acids, neurotransmitters (serotonin, norepinephrine), sphingolipids, aminolevulinic acid [MeSH].", 
"The conjugate acid of pyridoxamine arising from selective protonation of the primary amino group; major species at pH 7.3 [ChEBI]. The 4-aminomethyl form of VITAMIN B 6. During transamination of amino acids, PYRIDOXAL PHOSPHATE is transiently converted into pyridoxamine phosphate [MeSH].", 
"A naturally-occurring beta-amino acid comprising propionic acid with the amino group in the 3-position [ChEBI]. A non-essential amino acid that occurs in high levels in its free state in plasma. It is produced from pyruvate by transamination. It is involved in sugar and acid metabolism, increases IMMUNITY, and provides energy for muscle tissue, BRAIN, and the CENTRAL NERVOUS SYSTEM [MeSH].", 
"A pantothenic acid having R-configuration [ChEBI]. A butyryl-beta-alanine that can also be viewed as pantoic acid complexed with BETA ALANINE. It is incorporated into COENZYME A and protects cells against peroxidative damage by increasing the level of GLUTATHIONE [MeSH].", 
"A pyrimidinemonocarboxylic acid that is uracil bearing a carboxy substituent at position C-6 [ChEBI].", 
"A pyrimidine 2'-deoxyribonucleoside having uracil as the nucleobase [ChEBI]. 2'-Deoxyuridine. An antimetabolite that is converted to deoxyuridine triphosphate during DNA synthesis. Laboratory suppression of deoxyuridine is used to diagnose megaloblastic anemias due to vitamin B12 and folate deficiencies [MeSH].", 
"A metabolite of tryptophan with a possible role in neurodegenerative disorders. Elevated CSF levels of quinolinic acid are correlated with the severity of neuropsychological deficits in patients who have AIDS [MeSH].", 
"A pyridinemonocarboxylic acid in which the carboxy group is located at position 3 [ChEBI]. A water-soluble vitamin of the B complex occurring in various animal and plant tissues. It is required by the body for the formation of coenzymes NAD and NADP. It has PELLAGRA-curative, vasodilating, and antilipemic properties [MeSH].", 
"A pyridinecarboxamide in which the carboxamide group is located at position 3 [ChEBI]. An important compound functioning as a component of the coenzyme NAD. Its primary significance is in the prevention and/or cure of blacktongue and PELLAGRA. Most animals cannot manufacture this compound in amounts sufficient to prevent nutritional deficiency and it therefore must be supplemented through dietary intake [MeSH].", 
"The oxidised form of nicotinamide adenine dinucleotide found in all living cells. In metabolism, NAD(+) is involved in redox reactions, carrying electrons from one reaction to another [ChEBI]. A coenzyme composed of ribosylnicotinamide 5'-diphosphate coupled to adenosine 5'-phosphate by pyrophosphate linkage. It is found widely in nature and is involved in numerous enzymatic reactions in which it serves as an electron carrier by being alternately oxidized (NAD+) and reduced (NADH). (Dorland, 27th ed) [MeSH].", 
"Chloro(7,12-diethenyl-3,8,13,17-tetramethyl-21H,23H-porphine-2,18-dipropanoato(4-)-N(21),N(22),N(23),N(24)) ferrate(2-) dihydrogen [MeSH].", 
"Natural product isolated from Streptomyces pilosus. It forms iron complexes and is used as a chelating agent, particularly in the mesylate form [MeSH].", 
"A tripeptide compound consisting of glutamic acid attached via its side chain to the N-terminus of cysteinylglycine [ChEBI]. A tripeptide with many roles in cells. It conjugates to drugs to make them more soluble for excretion, is a cofactor for some enzymes, is involved in protein disulfide bond rearrangement and reduces peroxides [MeSH].", 
"An oxodicarboxylic acid that is succinic acid bearing a single oxo group [ChEBI]. A dicarboxylic acid ketone that is an important metabolic intermediate of the CITRIC ACID CYCLE. It can be converted to ASPARTIC ACID by ASPARTATE TRANSAMINASE [MeSH].", 
"An organic heterobicyclic compound that consists of 2-oxohexahydro-1H-thieno[3,4-d]imidazole having a valeric acid substituent attached to the tetrahydrothiophene ring. The parent of the class of biotins [ChEBI]. A water-soluble, enzyme co-factor present in minute amounts in every living cell. It occurs mainly bound to proteins or polypeptides and is abundant in liver, kidney, pancreas, yeast, and milk [MeSH].", 
"A cobalt-containing coordination compound produced by intestinal micro-organisms and found also in soil and water. Higher plants do not concentrate vitamin B 12 from the soil and so are a poor source of the substance as compared with animal tissues. INTRINSIC FACTOR is important for the assimilation of vitamin B 12 [MeSH].", 
"An aminobenzoic acid isomer that combines with pteridine and GLUTAMIC ACID to form FOLIC ACID. The fact that 4-aminobenzoic acid absorbs light throughout the UVB range has also resulted in its use as an ingredient in SUNSCREENS [MeSH].", 
"Folic acid is a form of the water-soluble vitamine B9. Its biologically active forms (tetrahydrofolate and others) are essential for nucleotide biosynthesis and homocysteine remethylation [ChEBI]. A member of the vitamin B family that stimulates the hematopoietic system. It is present in the liver and kidney and is found in mushrooms, spinach, yeast, green leaves, and grasses (POACEAE). Folic acid is used in the treatment and prevention of folate deficiencies and megaloblastic anemia [MeSH].", 
