"The coenzyme form of Vitamin B1 present in many animal tissues. It is a required intermediate in the PYRUVATE DEHYDROGENASE COMPLEX and the KETOGLUTARATE DEHYDROGENASE COMPLEX [MeSH].", 
"D-Ribitol in which the hydroxy group at position 5 is substituted by a 7,8-dimethyl-2,4-dioxo-3,4-dihydrobenzo[g]pteridin-10(2H)-yl moiety. It is a nutritional factor found in milk, eggs, malted barley, liver, kidney, heart, and leafy vegetables, but the richest natural source is yeast. The free form occurs only in the retina of the eye, in whey, and in urine; its principal forms in tissues and cells are as flavin mononucleotide and flavin-adenine dinucleotide [ChEBI]. Nutritional factor found in milk, eggs, malted barley, liver, kidney, heart, and leafy vegetables. The richest natural source is yeast. It occurs in the free form only in the retina of the eye, in whey, and in urine; its principal forms in tissues and cells are as FLAVIN MONONUCLEOTIDE and FLAVIN-ADENINE DINUCLEOTIDE [MeSH].", 
"A pyrroloquinoline having oxo groups at the 4- and 5-positions and carboxy groups at the 2-, 7- and 9-positions [ChEBI]. A pyrrolo-quinoline having two adjacent keto-groups at the 4 and 5 positions and three acidic carboxyl groups. It is a coenzyme of some DEHYDROGENASES [MeSH].", 
"A naphthoquinone having a methyl substituent at the 2-position [ChEBI]. A synthetic naphthoquinone without the isoprenoid side chain and biological activity, but can be converted to active vitamin K2, menaquinone, after alkylation in vivo [MeSH].", 
"A C8, straight-chain saturated fatty acid [ChEBI].", "The (R)-enantiomer of lipoic acid. A vitamin-like, C8 thia fatty acid with anti-oxidant properties [ChEBI]. An octanoic acid bridged with two sulfurs so that it is sometimes also called a pentanoic acid in some naming schemes. It is biosynthesized by cleavage of LINOLEIC ACID and is a coenzyme of oxoglutarate dehydrogenase (KETOGLUTARATE DEHYDROGENASE COMPLEX). It is used in DIETARY SUPPLEMENTS [MeSH].", 
"The (S)-enantiomer of mevalonic acid [ChEBI].", "A choline that is the parent compound of the cholines class, consisting of ethanolamine having three methyl substituents attached to the amino function [ChEBI]. A basic constituent of lecithin that is found in many plants and animal organs. It is important as a precursor of acetylcholine, as a methyl donor in various metabolic processes, and in lipid metabolism [MeSH].", 
