NA, "Decarboxylated arginine, isolated from several plant and animal sources, e.g., pollen, ergot, herring sperm, octopus muscle [MeSH].", 
"A straight-chain pentane core with amino substitutents at positions 1 and 5. A colourless syrupy liquid diamine with a distinctive unpleasant odour, it is a homologue of putresceine and is formed by the bacterial decarboxylation of lysine that occurs during protein hydrolysis during putrefaction of animal tissue [ChEBI]. A foul-smelling diamine formed by bacterial decarboxylation of lysine [MeSH].", 
"A four-carbon alkane-alpha,omega-diamine [ChEBI]. A toxic diamine formed by putrefaction from the decarboxylation of arginine and ornithine [MeSH].", 
"A 1H-imidazol-4-yl group substituted at position C-4 by a 2-aminoethyl group [ChEBI]. An amine derived by enzymatic decarboxylation of HISTIDINE. It is a powerful stimulant of gastric secretion, a constrictor of bronchial smooth muscle, a vasodilator, and also a centrally acting neurotransmitter [MeSH].", 
"A phenylethylamine having the phenyl substituent at the 2-position [ChEBI].", 
"A primary amino compound obtained by formal decarboxylation of the amino acid tyrosine [ChEBI]. An indirect sympathomimetic. Tyramine does not directly activate adrenergic receptors, but it can serve as a substrate for adrenergic uptake systems and monoamine oxidase so it prolongs the actions of adrenergic transmitters. It also provokes transmitter release from adrenergic terminals. Tyramine may be a neurotransmitter in some invertebrate nervous systems [MeSH].", 
"A derivative of glycine having methyl and amidino groups attached to the nitrogen [ChEBI]. An amino acid that occurs in vertebrate tissues and in urine. In muscle tissue, creatine generally occurs as phosphocreatine. Creatine is excreted as CREATININE in the urine [MeSH].", 
"An N-oxide derived from triethylamine [ChEBI].", "A carbonyl group with two C-bound amine groups [ChEBI]. A compound formed in the liver from ammonia produced by the deamination of amino acids. It is the principal end product of protein catabolism and constitutes about one half of the total urinary solids [MeSH].", 
NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, NA, "A broad-spectrum antibiotic derived from KANAMYCIN. It is reno- and oto-toxic like the other aminoglycoside antibiotics [MeSH].", 
"A TETRACYCLINE with a 7-chloro substitution [MeSH].", "A penicillin in which the substituent at position 6 of the penam ring is a 2-amino-2-(4-hydroxyphenyl)acetamido group [ChEBI]. A broad-spectrum semisynthetic antibiotic similar to AMPICILLIN except that its resistance to gastric acid permits higher serum levels with oral administration [MeSH].", 
"A semisynthetic penicillin antibiotic carrying a 3-(2-chlorophenyl)-5-methylisoxazole-4-carboxamido group at position 6 [ChEBI]. A semi-synthetic antibiotic that is a chlorinated derivative of OXACILLIN [MeSH].", 
"A fluoroquinolone antibiotic, used (generally as the hydrochloride salt) to treat bacterial infections including bronchitis and urinary tract infections. It is also used to prevent urinary tract infections prior to surgery [ChEBI].", 
"A glycopeptide antibiotic produced by the bacterium Streptomyces verticillus. The term, 'bleomycin' refers to a family of structurally related compounds. When used as an anti-cancer agent, the chemotherapeutical forms are primarily bleomycin A2 and B2 [ChEBI]. A complex of related glycopeptide antibiotics from Streptomyces verticillus consisting of bleomycin A2 and B2. It inhibits DNA metabolism and is used as an antineoplastic, especially for solid tumors [MeSH].", 
"A multi-component mixture comprising mostly of colistin A (R = Me) and B (R = H), with small amounts of colistin C and other polymyxins, produced by certain strains of Bacillus polymyxa var. colistinus. An antibiotic, it is used as its sulfate salt (for oral or topical use) or as the sodium salt of the N-methylsulfonic acid derivative (the injectable form) in the treatment of severe Gram-negative infections, partiularly those due to Pseudomonas aeruginosa [ChEBI]. Cyclic polypeptide antibiotic from Bacillus colistinus. It is composed of Polymyxins E1 and E2 (or Colistins A, B, and C) which act as detergents on cell membranes. Colistin is less toxic than Polymyxin B, but otherwise similar; the methanesulfonate is used orally [MeSH].", 
"Cyclic peptide antibiotic similar to VIOMYCIN. It is produced by Streptomyces capreolus [MeSH].", 
"Tetracycline which lacks the methyl substituent at position 7 and in which the hydrogen para- to the phenolic hydroxy group is substituted by chlorine. Like tetracycline, it is an antibiotic, but being excreted more slowly, effective blood levels are maintained for longer. It is used (mainly as the hydrochloride) for the treatment of Lyme disease, acne and bronchitis, as well as for hyponatraemia (low blood sodium concentration) due to the syndrome of inappropriate antidiuretic hormone (SIADH) where fluid restriction alone has been ineffective [ChEBI]. A TETRACYCLINE analog having a 7-chloro and a 6-methyl. Because it is excreted more slowly than TETRACYCLINE, it maintains effective blood levels for longer periods of time [MeSH].", 
"A semi-synthetic antibiotic related to penicillin [MeSH].", 
"A cephalosporin compound having [(5-methyl-1,3,4-thiadiazol-2-yl)sulfanyl]methyl and (1H-tetrazol-1-ylacetyl)amino side groups [ChEBI]. A semisynthetic cephalosporin analog with broad-spectrum antibiotic action due to inhibition of bacterial cell wall synthesis. It attains high serum levels and is excreted quickly via the urine [MeSH].", 
"A 1,4-dihydro-1,8-naphthyridine with an ethyl group at the 1 position, a carboxy group at the 3-position, an oxo sustituent at the 4-position, a fluoro substituent at the 5-position and a piperazin-1-yl group at the 7 position. An antibacterial, it is used in the treatment of urinary-tract infections and gonorrhoea [ChEBI]. A broad-spectrum 6-fluoronaphthyridinone antibacterial agent (FLUOROQUINOLONES) structurally related to NALIDIXIC ACID [MeSH].", 
"Any of several wide-spectrum macrolide antibiotics obtained from actinomycete Saccharopolyspora erythraea (formerly known as Streptomyces erythraeus) [ChEBI]. A bacteriostatic antibiotic macrolide produced by Streptomyces erythreus. Erythromycin A is considered its major active component. In sensitive organisms, it inhibits protein synthesis by binding to 50S ribosomal subunits. This binding process inhibits peptidyl transferase activity and interferes with translocation of amino acids during translation and assembly of proteins [MeSH].", 
"A broad-spectrum highly toxic antibiotic or mixture of antibiotics produced by a streptomyces (Streptomyces fradiae) and used medically especially to treat local infections [ChEBI]. Antibiotic complex produced by Streptomyces fradiae. It is composed of neomycins A, B, and C. It acts by inhibiting translation during protein synthesis [MeSH].", 
"A cephalosporin compound having 2-(2-amino-1,3-thiazol-4-yl)-2-(methoxyimino)acetylamino and [(2-methyl-5,6-dioxo-1,2,5,6-tetrahydro-1,2,4-triazin-3-yl)sulfanyl]methyl side groups [ChEBI]. A broad-spectrum cephalosporin antibiotic with a very long half-life and high penetrability to meninges, eyes and inner ears [MeSH].", 
"Any of a group of aminoglycoside antibiotics produced by fermentation of some Micromonospora spp [ChEBI]. A complex of three different closely related aminoglycoside sulfates, Gentamicins C1, C2, and C1(subA), obtained from Micromonospora purpurea and related species. They are broad-spectrum antibiotics, but may cause ear and kidney damage. They act to inhibit protein synthesis (GENETIC TRANSLATION) [MeSH].", 
"A semisynthetic, first-generation cephalosporin antibiotic with acetoxymethyl and (2-thienylacetyl)nitrilo moieties at positions 3 and 7, respectively, of the core structure. Administered parenterally during surgery and to treat a wide spectrum of blood infections [ChEBI]. A cephalosporin antibiotic [MeSH].", 
"Kanamycin is a naturally occurring antibiotic complex from Streptomyces kanamyceticus that consists of several components: kanamycin A, the major component (also usually designated as kanamycin), and kanamycins B, C, D and X the minor components [ChEBI]. Antibiotic complex produced by Streptomyces kanamyceticus from Japanese soil. Comprises 3 components: kanamycin A, the major component, and kanamycins B and C, the minor components [MeSH].", 
"A synthetic fluoroquinolone antibacterial agent that inhibits the supercoiling activity of bacterial DNA gyrase, halting DNA replication [ChEBI]. A synthetic fluoroquinolone (FLUOROQUINOLONES) antibacterial agent that inhibits the supercoiling activity of bacterial DNA GYRASE, halting DNA REPLICATION [MeSH].", 
"A penicillin in which the substituent at position 6 of the penam ring is a phenylacetamido group [ChEBI]. A penicillin derivative commonly used in the form of its sodium or potassium salts in the treatment of a variety of infections. It is effective against most gram-positive bacteria and against gram-negative cocci. It has also been used as an experimental convulsant because of its actions on GAMMA-AMINOBUTYRIC ACID mediated synaptic transmission [MeSH].", 
"A broad-spectrum polyketide antibiotic produced by the Streptomyces genus of actinobacteria [ChEBI]. A naphthacene antibiotic that inhibits AMINO ACYL TRNA binding during protein synthesis [MeSH].", 
"A penicillin antibiotic having a 6beta-2-carboxy-2-phenylacetamido side chain [ChEBI]. Broad-spectrum semisynthetic penicillin derivative used parenterally. It is susceptible to gastric juice and penicillinase and may damage platelet function [MeSH].", 
"A penicillin antibiotic carrying a 5-methyl-3-phenylisoxazole-4-carboxamide group at position 6 [ChEBI]. An antibiotic similar to FLUCLOXACILLIN used in resistant staphylococci infections [MeSH].", 
NA, "A polymyxin having a (6R)-6-methyloctanoyl group at the amino terminus [ChEBI]. A mixture of polymyxins B1 and B2, obtained from Bacillus polymyxa strains. They are basic polypeptides of about eight amino acids and have cationic detergent action on cell membranes. Polymyxin B is used for infections with gram-negative organisms, but may be neurotoxic and nephrotoxic [MeSH].", 
"An amino cyclitol glycoside that is the 1-O-(2-amino-2-deoxy-alpha-D-glucopyranoside) and the 3-O-(2,6-diamino-2,6-dideoxy-beta-L-idopyranosyl)-beta-D-ribofuranoside of 4,6-diamino-2,3-dihydroxycyclohexane (the 1R,2R,3S,4R,6S diastereoisomer). It is obtained from various Streptomyces species. A broad-spectrum antibiotic, it is used (generally as the sulfate salt) for the treatment of acute and chronic intestinal protozoal infections, but is not effective for extraintestinal protozoal infections. It is also used as a therapeutic against visceral leishmaniasis [ChEBI]. An oligosaccharide antibiotic produced by various STREPTOMYCES [MeSH].", 
"An alpha-amino acid that is alanine substituted at position 3 by a hydroxy group [ChEBI]. A non-essential amino acid occurring in natural form as the L-isomer. It is synthesized from GLYCINE or THREONINE. It is involved in the biosynthesis of PURINES; PYRIMIDINES; and other amino acids [MeSH].", 
"Antibiotic produced by Micromonospora inyoensis. It is closely related to gentamicin C1A, one of the components of the gentamicin complex (GENTAMICINS) [MeSH].", 
"A pyrimidine compound having methyl substituents at the 4- and 6-positions and a 4-aminobenzenesulfonamido group at the 2-position [ChEBI]. A sulfanilamide anti-infective agent. It has a spectrum of antimicrobial action similar to other sulfonamides [MeSH].", 
"A coumarin-derived antibiotic obtained from Streptomyces niveus [ChEBI]. An antibiotic compound derived from Streptomyces niveus. It has a chemical structure similar to coumarin. Novobiocin binds to DNA gyrase, and blocks adenosine triphosphatase (ATPase) activity. (From Reynolds, Martindale The Extra Pharmacopoeia, 30th ed, p189) [MeSH].", 
"A member of the class of pteridines that is pteridine in which the hydrogens at positions 2 and 4 are replaced by amino groups, whilst those at positions 6 and 7 are replaced by isopropyl groups [ChEBI].", 
"A pyrimidine compound having a 4-aminobenzenesulfonamido group at the 2-position [ChEBI]. One of the short-acting SULFONAMIDES used in combination with PYRIMETHAMINE to treat toxoplasmosis in patients with acquired immunodeficiency syndrome and in newborns with congenital infections [MeSH].", 
"Bactericidal cationic quaternary ammonium surfactant used as a topical anti-infective agent. It is an ingredient in medicaments, deodorants, mouthwashes, etc., and is used to disinfect apparatus, etc., in the food processing and pharmaceutical industries, in surgery, and also as a preservative. The compound is toxic orally as a result of neuromuscular blockade [MeSH].", 
"A amino cyclitol glycoside that is kanamycin B lacking the 3-hydroxy substituent from the 2,6-diaminoglucose ring [ChEBI]. An aminoglycoside, broad-spectrum antibiotic produced by Streptomyces tenebrarius. It is effective against gram-negative bacteria, especially the PSEUDOMONAS species. It is a 10% component of the antibiotic complex, NEBRAMYCIN, produced by the same species [MeSH].", 
"A 1,3-thiazole compound having a 4-aminobenzenesulfonamido group at the 2-position [ChEBI].", 
NA, "An antibiotic produced by Streptomyces spectabilis. It is active against gram-negative bacteria and used for the treatment of gonorrhea [MeSH].", 
"An isoxazole (1,2-oxazole) compound having a methyl substituent at the 5-position and a 4-aminobenzenesulfonamido group at the 3-position [ChEBI]. A bacteriostatic antibacterial agent that interferes with folic acid synthesis in susceptible bacteria. Its broad spectrum of activity has been limited by the development of resistance. (From Martindale, The Extra Pharmacopoeia, 30th ed, p208) [MeSH].", 
"L-Asparagine hydroxylated at N-4 [ChEBI].", "A macrolide antibiotic produced by Streptomyces ambofaciens. The drug is effective against gram-positive aerobic pathogens, N. gonorrhoeae, and staphylococci. It is used to treat infections caused by bacteria and Toxoplasma gondii [MeSH].", 
"A rifamycin that is a a semisynthetic antibiotic derived from Amycolatopsis rifamycinica (previously known as Amycolatopsis mediterranei and Streptomyces mediterranei) [ChEBI]. A semisynthetic antibiotic produced from Streptomyces mediterranei. It has a broad antibacterial spectrum, including activity against several forms of Mycobacterium. In susceptible organisms it inhibits DNA-dependent RNA polymerase activity by forming a stable complex with the enzyme. It thus suppresses the initiation of RNA synthesis. Rifampin is bactericidal, and acts on both intracellular and extracellular organisms. (From Gilman et al., Goodman and Gilman's The Pharmacological Basis of Therapeutics, 9th ed, p1160) [MeSH].", 
"A quarternary ammonium cation having one dodecyl and three methyl substituents around the central nitrogen [ChEBI].", 
"A penicillin in which the substituent at position 6 of the penam ring is a 2-amino-2-phenylacetamido group [ChEBI]. Semi-synthetic derivative of penicillin that functions as an orally active broad-spectrum antibiotic [MeSH].", 
"A topical bacteriostat that is available as various salts. It is used in wound dressings and mouth infections and may also have antifungal action, but may cause skin ulceration [MeSH].", 
"A compound of nickel and chloride in which the ratio of nickel (in the +2 oxidation state) to chloride is 1:2 [ChEBI].", 
"A semisynthetic penicillin antibiotic used in treating infections caused by Pseudomonas aeruginosa, Escherichia coli, and Haemophilus influenzae [ChEBI]. A semisynthetic ampicillin-derived acylureido penicillin [MeSH].", 
"A reagent used for the determination of iron [MeSH].", "A quinolinemonocarboxylic acid having the carboxy group at position 7 as well as oxo- and ethyl groups at positions 4 and 1 respectively and a dioxolo ring fused at the 5- and 6-positions [ChEBI]. Synthetic antimicrobial related to NALIDIXIC ACID and used in URINARY TRACT INFECTIONS [MeSH].", 
"Tetracycline in which the 5beta-hydrogen is replaced by a hydroxy group, while the 6alpha-hydroxy group is replaced by hydrogen. A semi-synthetic tetracycline antibiotic, it is used to inhibit bacterial protein synthesis and treat non-gonococcal urethritis and cervicitis, exacerbations of bronchitis in patients with chronic obstructive pulmonary disease (COPD), and adult periodontitis [ChEBI]. A synthetic tetracycline derivative with similar antimicrobial activity [MeSH].", 
"A 3-(carbamoyloxymethyl)cephalosporin compound having a 7-(2Z)-2-(furan-2-yl)-2-(methoxyimino)acetamido side chain [ChEBI]. Broad-spectrum cephalosporin antibiotic resistant to beta-lactamase. It has been proposed for infections with gram-negative and gram-positive organisms, GONORRHEA, and HAEMOPHILUS [MeSH].", 
"A derivative of tetracycline in which the amide function is substituted with a pyrrolidinomethyl group [ChEBI]. A pyrrolidinylmethyl TETRACYCLINE [MeSH].", 
"A pyrimidine nucleoside analog that is used mainly in the treatment of leukemia, especially acute non-lymphoblastic leukemia. Cytarabine is an antimetabolite antineoplastic agent that inhibits the synthesis of DNA. Its actions are specific for the S phase of the cell cycle. It also has antiviral and immunosuppressant properties. (From Martindale, The Extra Pharmacopoeia, 30th ed, p472) [MeSH].", 
"An aminoglycoside antibiotic produced by Micromonospora rhodorangea. It blocks polypeptide synthesis  by inhibiting the elongation step in both prokaryotic and eukaryotic cells [ChEBI].", 
"An inorganic dye used in microscopy for differential staining and as a diagnostic reagent. In research this compound is used to study changes in cytoplasmic concentrations of calcium. Ruthenium red inhibits calcium transport through membrane channels [MeSH].", 
"The inorganic chloride salt of caesium; each caesium ion is coordinated by eight chlorine ions [ChEBI].", 
