"An antibiotic whose structure consists of pyrimidine 2,4-diamine and 1,2,3-trimethoxybenzene moieties linked by a methylene bridge [ChEBI]. A pyrimidine inhibitor of dihydrofolate reductase, it is an antibacterial related to PYRIMETHAMINE. The interference with folic acid metabolism may cause a depression of hematopoiesis. It is potentiated by SULFONAMIDES and the TRIMETHOPRIM-SULFAMETHOXAZOLE COMBINATION is the form most often used. It is sometimes used alone as an antimalarial. TRIMETHOPRIM RESISTANCE has been reported [MeSH].", 
NA, "A group of simple proteins that yield basic amino acids on hydrolysis and that occur combined with nucleic acid in the sperm of fish. Protamines contain very few kinds of amino acids. Protamine sulfate combines with heparin to form a stable inactive complex; it is used to neutralize the anticoagulant action of heparin in the treatment of heparin overdose. (From Merck Index, 11th ed; Martindale, The Extra Pharmacopoeia, 30th ed, p692) [MeSH].", 
"Cationic bactericidal surfactant used as a topical antiseptic for skin, wounds, mucous membranes, instruments, etc.; and also as a component in mouthwash and lozenges [MeSH].", 
"A chlorobenzene compound with two nitro substituents in the 2- and 4-positions [ChEBI]. A skin irritant that may cause dermatitis of both primary and allergic types. Contact sensitization with DNCB has been used as a measure of cellular immunity. DNCB is also used as a reagent for the detection and determination of pyridine compounds [MeSH].", 
